INSERT INTO `block_content__body` VALUES ('content_block_with_image',0,1,3,'en',0,'<h2>MALTAS Y CERVEZAS DE MURCIA</h2>\r\n','','basic_html'),('content_block_2',0,2,2,'en',0,'<p>En Estrella de Levante llevamos más de 50 años elaborando la cerveza por excelencia de los murcianos. Nuestra historia comienza en 1963 en la pedanía murciana de Espinardo, con la inauguración de nuestra fábrica, que más de cinco décadas después se ha convertido en todo un símbolo de la Región.</p>\r\n\r\n<p>Si hay algo que nos ha caracterizado desde nuestros comienzos ha sido nuestro compromiso con la sociedad murciana, con las personas, con el medio ambiente y con la calidad de nuestros productos.</p>\r\n','','basic_html'),('content_block',0,3,4,'en',0,'<p><strong>¿Te gustaría conocer cómo elaboramos Estrella de Levante?</strong></p>\r\n\r\n<p>Te abrimos las puertas de nuestra fábrica para que conozcas todo el proceso de elaboración, desde el malteado de la cebada hasta su envasado final. Además, podrás disfrutar de una degustación muy cervecera.</p>\r\n','','basic_html'),('content_block_3',0,4,5,'en',0,'<h2>I CONCURSO DE TIRAJE&gt;</h2>\r\n','','basic_html'),('content_block_with_image',0,5,6,'en',0,'<p>REFRESCANTE Y CON SABOR</p>\r\n','','basic_html'),('content_block_with_image',0,6,7,'en',0,'<p>UNA 0,0 CON TODO EL SABOR</p>\r\n','','basic_html'),('content_block_with_image',0,7,8,'en',0,'<p>CERVEZA TOSTADA</p>\r\n','','basic_html'),('content_block_with_image',0,8,9,'en',0,'<p>ELABORADA CON LIMONES DE MURCIA</p>\r\n','','basic_html'),('content_block_with_image',0,9,10,'en',0,'<p>CON TODO EL SABOR A MALTAS TOSTADAS</p>\r\n','','basic_html'),('nota_cata',0,10,11,'en',0,'<p><span><span><span><span>De color dorado y aspecto fluido y brillante, con muy buena permanencia de espuma en copa. </span></span></span></span></p>\r\n\r\n<p><span><span><span><span>En nariz, es intensa destacando los aromas herbales, acompañados por toques cítricos. </span></span></span></span></p>\r\n\r\n<p><span><span><span><span>En boca, sus notas a malta están perfectamente equilibradas con el amargor del lúpulo proporcionándole un final eminentemente refrescante.</span></span></span></span></p>\r\n','','basic_html'),('nota_cata',0,11,12,'en',0,'<p>Caracterizada por su frescura y equilibrado amargor, conserva toda la originalidad de Estrella de Levante gracias a un proceso único de desalcoholización y recuperación de aromas que permite disfrutar de una cerveza 0,0 con todo el sabor.</p>\r\n','','basic_html');
