INSERT INTO `node__body` VALUES ('page',0,1,8,'en',0,'<h2>AVISO LEGAL</h2>\r\n\r\n<p><strong>AVISO LEGAL: CONDICIONES GENERALES DE ACCESO Y USO<br />\r\nPROPIEDAD DE LA PÁGINA WEB Y SU CONTENIDO.</strong></p>\r\n\r\n<p>ESTRELLA DE LEVANTE FÁBRICA DE CERVEZA, S.A.U., con CIF A30009153, domiciliada en Espinardo, (Murcia), Calle Mayor, nº 171 e inscrita en el Registro Mercantil de Murcia, al Tomo 87, folio 188, hoja número MU-1895, informa a los Usuarios de la página web <a href=\"https://www.estrelladelevante.es\">www.estrelladelevante.es</a> , de la que es titular, de las Condiciones de Acceso y Uso de la misma.</p>\r\n\r\n<p>El acceso y utilización a cualquier página web titularidad de ESTRELLA DE LEVANTE FÁBRICA DE CERVEZA, S.A.U supone la aceptación plena y sin reservas por parte del Usuario de las presentes Condiciones Generales de Acceso y Uso vigentes en cada momento en que el Usuario acceda a cualquiera de las citadas páginas web. Estas Condiciones Generales por tanto, regulan el acceso y uso de los sitios web que ESTRELLA DE LEVANTE FÁBRICA DE CERVEZA, S.A.U pone gratuitamente a disposición de los Usuarios de Internet. La utilización de determinados servicios ofrecidos en alguno de los sitios web de ESTRELLA DE LEVANTE FÁBRICA DE CERVEZA, S.A.U se puede regir además por condiciones particulares previstas en cada caso, las cuales se entenderán aceptadas por el mero uso de tales servicios.</p>\r\n\r\n<p>Cuando el usuario accede a los sitios web de ESTRELLA DE LEVANTE FÁBRICA DE CERVEZA, S.A.U confirma haber leído el presente Aviso Legal. Los sitios web de ESTRELLA DE LEVANTE FÁBRICA DE CERVEZA, S.A.U están destinados a Usuarios mayores de edad.</p>\r\n\r\n<p>ESTRELLA DE LEVANTE FÁBRICA DE CERVEZA, S.A.U no garantiza que los contenidos de sus Páginas sean aptos o disponibles fuera de España. En el supuesto de que todo o parte de los contenidos de las Páginas de ESTRELLA DE LEVANTE FÁBRICA DE CERVEZA, S.A.U sean considerados ilegales en países distintos a España,