n la autorización expresa de ESTRELLA DE LEVANTE FÁBRICA DE CERVEZA, S.A.U o el autor legítimo.</p>\r\n\r\n<p>La utilización no autorizada de la información contenida en las páginas web de ESTRELLA DE LEVANTE FÁBRICA DE CERVEZA, S.A.U, su modificación o supresión de datos, así como la lesión de los Derechos de Propiedad Intelectual o Industrial de ESTRELLA DE LEVANTE FÁBRICA DE CERVEZA, S.A.U dará lugar a las responsabilidades legalmente establecidas.</p>\r\n\r\n<h2><br />\r\nEXONERACIÓN DE RESPONSABILIDAD.</h2>\r\n\r\n<p>Todos los Usuarios de estos sitios web lo hacen bajo su propio riesgo, y al acceder a ellos aceptan utilizarlo según las leyes y usos de tráfico y deberán responder ante ESTRELLA DE LEVANTE FÁBRICA DE CERVEZA, S.A.U u otras empresas, por cualquier daño que pueda haber sido producido como resultado de un incumplimiento de estas obligaciones.</p>\r\n\r\n<p>Tanto el acceso a los sitios web de ESTRELLA DE LEVANTE FÁBRICA DE CERVEZA, S.A.U como el uso que pueda hacerse de la información contenido en los mismos es de la exclusiva responsabilidad de quien lo realiza. ESTRELLA DE LEVANTE FÁBRICA DE CERVEZA, S.A.U no responderá de ninguna consecuencia, daño o perjuicio que pudieran derivarse del acceso o uso de dicha información.</p>\r\n\r\n<p>ESTRELLA DE LEVANTE FÁBRICA DE CERVEZA, S.A.U no se responsabiliza de los posibles errores de seguridad que puedan producirse ni de cualquier daño o perjuicio que pueda causarse al sistema informático del Usuario, los ficheros o documentos almacenados en el mismo como consecuencia del acceso a las Páginas web de ESTRELLA DE LEVANTE FÁBRICA DE CERVEZA, S.A.U o del uso de información o aplicaciones en ella contenidas.</p>\r\n\r\n<p>ESTRELLA DE LEVANTE FÁBRICA DE CERVEZA, S.A.U no asume responsabilidad alguna derivada de la concesión o contenidos de los enlaces de terceros a los que se hace referencia en sus sitios web o que terceras partes hayan incluido en los hipervínculos. El establecimiento del hipervínculo no impli